/* cmdyylex_destroy is for both reentrant and non-reentrant scanners. */
int cmdyylex_destroy  (void)
{
    
    /* Pop the buffer stack, destroying each element. */
	while(YY_CURRENT_BUFFER){
		cmdyy_delete_buffer(YY_CURRENT_BUFFER  );
		YY_CURRENT_BUFFER_LVALUE = NULL;
		cmdyypop_buffer_state();
	}

	/* Destroy the stack itself. */
	cmdyyfree((yy_buffer_stack) );
	(yy_buffer_stack) = NULL;

    /* Destroy the start condition stack. */
        cmdyyfree((yy_start_stack)  );
        (yy_start_stack) = NULL;

    cmdyyfree ( (yy_state_buf) );
    (yy_state_buf)  = NULL;

    /* Reset the globals. This is important in a non-reentrant scanner so the next time
     * cmdyylex() is called, initialization will occur. */
    yy_init_globals( );

    return 0;
}

